import React  from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
/*const useStyles = makeStyles(theme => ({
    textField: {
      marginLeft: theme.spacing(1),
      marginRight: theme.spacing(1),
      width: 200,
    },
  }));*/
type Props = {
    onSubmit: Function,
    onChange: Function,
    lastname: string,
    firstname: string,
    username: string,
    email: string,
    password: string,
    confirmPassword: string
}
const Register = ({onSubmit, onChange, lastname, firstname, username, email, password, confirmPassword} : Props) => {
    //const classes = useStyles();

        return (
            <div>
                <h1 >Sign Up</h1>
                <form>
                    <TextField  id="firstname" label="fistname" type="text" name="firstname" value={firstname} onChange={onChange}/>
                    <TextField  id="lastname" label="lastname" type="text" name="lastname" value={lastname} onChange={onChange}/>
                    <TextField  id="username" label="username" type="text" name="username" value={username} onChange={onChange}/>
                    <TextField  id="email" label="email" type="email" name="email" value={email} onChange={onChange}/>
                    <TextField  id="password" label="password" type="password" name="password" value={password} onChange={onChange}/>
                    <TextField  id="confirmPassword" label="confirm password" type="password" name="confirmPassword" value={confirmPassword} onChange={onChange}/>
                    <Button type="submit" variant="contained" color="primary"  value="SignUp" onSubmit = {onSubmit}>Submit</Button>
                </form>


            </div>
        )


}

export default Register;
